import React, { Component } from 'react'
import Chart from './Chart'

const data = {
    title: {
        text: 'My chart'
    },
    series: [{
        name: 'Profits',
        data: [1, 2, 3]
    }]
}

class LineChart extends Component {
    constructor(props) {
        super(props)
        this.state = { data: [] }
    }

    render() {
        return (
            <Chart data={data} />
        )
    }
}

export default LineChart
